INSERT INTO `sys_notice` VALUES (4, '武汉病毒研究所声明：我所毕业生黄燕玲不是新冠肺炎“零号病人”', ' 近期网络流传不实信息，称我所毕业生黄燕玲是所谓的最早感染新冠病毒的“零号病人”。', 0, NULL, '<p>\n</p><div><p><span style=\"color: inherit;\">&nbsp; &nbsp;&nbsp;</span><span>近期网络流传不实信息，称我所毕业生黄燕玲是所谓的最早感染新冠病毒的“零号病人”。经查证，我所<font color=\"#c24f4a\">郑重声明</font>如下：</span></p><p><span style=\"color: inherit;\">&nbsp; &nbsp;&nbsp;</span><span>黄燕玲同学于2015年在我所毕业获得硕士学位，在学期间的研究内容为噬菌体裂解酶的功能及抗菌广谱性，毕业后一直在其他省份工作生活，未曾回过武汉，未曾被2019新型冠状病毒感染，身体健康。</span></p><p>       </p><p><span style=\"color: inherit;\">&nbsp; &nbsp;&nbsp;</span><span>值此抗疫关键时刻，相关谣言极大干扰了我所的科研攻关工作。我们保留依法追究法律责任的权利。衷心感谢社会各界对我所的关心、支持和帮助！</span></p><div align=\"center\"><img src=\"https://www.huishu.ltd/static/upload/2020-02-20_1582162489394.png\" style=\"max-width:100%;\"><br></div><p><span><span style=\"font-weight: bold;\">来源</span>：<span style=\"text-decoration: underline;\">中国科学院武汉病毒研究所网站</span></span></p></div>\n\n<p><br></p>', '2', NULL, '1', '2020-02-16 16:35:41', '2020-02-20 09:34:52', '1  ');
INSERT INTO `sys_notice` VALUES (26, '武汉第八医院院长王萍感染新冠肺炎，正住院治疗', '新京报讯（记者 倪兆中）新京报记者今日（2月19日）从武汉市第八医院获悉，该院院长王萍感染新冠肺炎，目前正在武汉市金银潭医院住院治疗。', 0, NULL, '<p>\n</p><div><p><span>&nbsp;&nbsp;&nbsp; 今日上午，一条网传求助信息称武汉市第八医院院长王萍，在疫情出现后奋战在一线，不幸感染新冠肺炎，目前正在金银潭医院重症监护室抢救治疗。情况危急，急需救命血浆。</span></p><p><span>&nbsp;&nbsp;&nbsp; 新京报记者今日下午从武汉市第八医院前台以及负责宣传的工作人员处证实，该院院长王萍因感染新冠肺炎，正在武汉金银潭医院住院治疗。对于网传王萍救治急需血浆一事，该院负责宣传的工作人员表示，据其了解目前已找到供应血浆。</span></p><p style=\"text-align: center;\"><span><img src=\"https://www.huishu.ltd/static/upload/2020-02-20_1582162455844.jpg\" style=\"max-width:100%;\"></span></p><p><span>&nbsp;&nbsp;&nbsp; 新京报记者致电金银潭医院，接线护士表示，若患者有相关需要，目前该院血浆基本可以满足需求。<span></span></span></p><p><span style=\"text-decoration: underline;\">校对 卢茜</span></p></div>\n\n', '3', NULL, '1', '2020-02-20 09:34:43', '2020-02-20 09:35:37', '1  ');
INSERT INTO `sys_notice` VALUES (27, '复工后如何做好个人防护？专家为你支招', '近日，中国疾控中心研究员李涛就疫情期间复工，企业和员工如何做好健康防护等相关问题进行了解答。', 0, NULL, '<p>\n</p><p>&nbsp;&nbsp;&nbsp; 近日，中国疾控中心研究员李涛就疫情期间复工，企业和员工如何做好健康防护等相关问题进行了解答。</p><p>&nbsp;&nbsp;&nbsp; 1、工作时大批人员聚集，员工可能出现紧张和焦虑的情绪，企业应当如何应对？</p><p>因为疫情期间复工，很难避免员工出现紧张情绪，所以企业应该早做应对。</p><p>&nbsp;&nbsp;&nbsp; 一是结合工作场所健康促进和健康企业建设。采用多种方式开展新冠肺炎防控知识宣传教育，引导员工科学理性认识疫情，做好个人防护，理解、支持、配合疫情防控工作。</p><p>&nbsp;&nbsp;&nbsp; 二是及时了解和掌握员工的心理健康状况，疏解员工的紧张焦虑情绪。企业可以开展心理健康服务，可以设立心理健康的咨询电话，设有医务室的企业可充分发挥医务室的作用，没有医务室的企业可以依托心理健康或者疾控专业机构来为企业员工提供心理健康服务。</p><p>&nbsp;&nbsp;&nbsp; 三是发现可能出现群体心理健康危机苗头时，企业应该及时向属地的疫情联防联控工作机制组报告，要采取有效措施。建议企业应该有预防和控制歧视患病员工或者疑似患病员工的一些措施。</p><p>&nbsp;&nbsp;&nbsp; 2、如何处理既要工作又做好个人防护的关系？</p><p>&nbsp;&nbsp;&nbsp; 建议工作场所要全程佩戴防护口罩。工作场所存在粉尘和毒物的，既要考虑对新冠肺炎的防控，也要考虑对所接触危害因素的防控，还要注意口罩防护效率和密合度是不是符合要求。在办公场所办公，一个人办公可以不戴口罩，但多人办公时建议佩戴口罩。</p><p>&nbsp;&nbsp;&nbsp; 有条件的办公场所应该适当加大座位之间的距离。要注意保持工作服、座椅套等织物的清洁并定期消毒。</p><p>&nbsp;&nbsp;&nbsp; 建议加强手卫生措施。养成勤洗手、正确洗手的习惯，不能确定手是否清洁的时候避免用手接触口鼻和眼睛，要减少手接触公共物品和部位。</p><p>&nbsp;&nbsp;&nbsp; 要定期对工作台、操作按钮，对一些物品表面进行消毒。对于多人操作的设备，要对接触部位比较多的表面或者配件进行消毒，如果工作作业允许佩戴手套可以佩戴手套作业。</p><p>&nbsp;&nbsp;&nbsp; 减少人群聚集，避免到人群聚集尤其是通风条件比较差的场所，外出时要做好个人防护和手卫生。</p><p>&nbsp;&nbsp;&nbsp; 企业有食堂的可以实施错峰就餐，或者打包到各自工位、休息室就餐，也可以提供盒饭，鼓励员工自带饭盒。就餐时要注意与他人保持一定距离，减少交谈。</p><p>&nbsp;&nbsp;&nbsp; 要注意自己的健康状况，一旦出现发热、乏力、咳嗽等症状要避免接触他人并佩戴口罩。要按照规定及时到指定医院就医，避免乘坐公共交通工具。在去医院的路上以及医院内，一定要全程佩戴防护口罩。</p>\n\n', '5', NULL, '1', '2020-02-21 17:26:01', '2020-02-21 17:26:01', NULL);
INSERT INTO `sys_notice` VALUES (28, '省联社领导会见包河区常委吴红一行', '     2月17日，省联社党委书记、理事长钟园，党委副书记陈华会见了来社检查指导疫情防控工作的包河区常委、宣传部长吴红一行。', 0, NULL, '<p style=\"text-align: center;\"><img style=\"max-width:100%;\" src=\"http://www.ahrcu.com/upload/2020-02/2020021715433573456717782.jpg\"></p><p>\n</p><p style=\"text-indent:21.0pt;mso-char-indent-count:2.0;\nline-height:150%\"><span lang=\"EN-US\">2</span><span>月<span lang=\"EN-US\">17</span>日，省联社党委书记、理事长钟园，党委副书记陈华会见了来社检查指导疫情防控工作的包河区常委、宣传部长吴红一行。<span lang=\"EN-US\"></span></span></p>\n\n<p style=\"text-indent:21.0pt;mso-char-indent-count:2.0;\nline-height:150%\"><span lang=\"EN-US\">&nbsp;</span></p>\n\n<p style=\"text-indent:21.0pt;mso-char-indent-count:2.0;\nline-height:150%\"><span>会见期间，钟园向吴红一行介绍了省联社在加强机关本部疫情防控工作方面采取的具体措施，以及指导全系统在加强疫情防控的同时，充分发挥金融职能作用，积极支持各地重点保障企业复工生产的有关情况。吴红传达了属地党委政府对疫情防控工作的具体要求，对省联社机关的疫情防控工作进行了检查并提出了意见和建议。<span lang=\"EN-US\"></span></span></p>\n\n<p style=\"text-indent:21.0pt;mso-char-indent-count:2.0;\nline-height:150%\"><span lang=\"EN-US\">&nbsp;</span></p>\n\n<p style=\"text-indent:21.0pt;mso-char-indent-count:2.0;\nline-height:150%\"><span>省联社办公室、综合管理部及包河区相关部门机构的负责人参加座谈。</span></p>\n\n<p>\n\n\n</p>', '4', NULL, '1', '2020-02-21 17:47:19', '2020-02-21 17:47:38', '1  ');
